import React, {Component} from 'react';
import './footer.scss'

export default function Footer(props) {
    const footerNav = {
        links: {
            name: 'Our World',
            name: 'Create Your Future Today',
            name: 'Explore Our Projects'
        }
    };

    return (
        <div>
            <footer className="py-5">
                <h1 className="text-center">hello world</h1>
            </footer>
        </div>
    )
}
